技术实施工程师（宜春）（有一定的开发能力，会使用开发软件）
岗位职责：1、负责参与项目前期的沟通和方案建设，对项目自立项至结项周期过程中的工作计划、组织、执行、监控等工作; 
2、根据项目要求，制订项目实施计划与项目实施方案，按计划和方案推进项目按期交付和结项: 
3、负责管理实施过程中的需求整理和反馈，保持与客户的联系，及时沟通和解决项目实施过程中的问题，给公司、客户汇报项目进度，保证客户满意度 
4、负责现场项目沟通协调及文档管理; 
5、负责推动项目周期内项目的上线、培训工作，及对项目各个阶段及整体工作的完成情况做定期和及时汇报;
6、参与南昌省平台项目需求讨论，根据省平台项目产成模块功能编码、单元测试和维护工作，确保项目交付质量;
7、客户现场驻场负责分析并协调系统运营过程中在客户现场发现的问题，并配合项目研发组快速定位并修复现有系统缺陷，为产品运营提供升级、维护等技术支持；

任职要求：1、专科及以上学历，具备技术背景，熟悉医院系统实施，有大型医院软件项目管理经验、项目管理相关资质证书者优先; 
2、熟悉 LINUX系统及Docker集群部署方式，熟悉关系型数据库(MySQL、Oracle、SalServer)或非关系型数据库(MongoDB) sql语句编写，熟悉 IIS、 Apache、Tomcat、Redis等中间件的安装部署等;
3、具备一定的组织计划协调能力、能够协调客户及第三方软件资源的对接，推进软件实施进度及对接进度;
 4、具备良好的沟通能力，思维逻辑能力，抗压能力，可以理解、引导、管理客户的需求; 
 5、具备较好的文档编写、总结归纳能力，良好的问题分析及解决问题能力;
 6、思路清晰，执行力强，具备较强的学习能力、团队意识和协作精神，有良好的职业道德和综合素质;
7、能适应出差中短期驻场项目管理，以及多地多项目统筹性管理。

每天工作时间7.5小时，双休
